        private static readonly IReadOnlyDictionary<string, uint> KeyToId = BuildKeyToId();

        private static Dictionary<string, uint> BuildKeyToId()
        {
            var map = new Dictionary<string, uint>(StringComparer.OrdinalIgnoreCase);
            foreach (var kvp in IdToKeySuffix)
            {
                map[KeyPrefix + kvp.Value] = kvp.Key;
            }
            return map;
        }

        public static bool TryGetKey(uint id, out string key)
        {
            if (IdToKeySuffix.TryGetValue(id, out var suffix))
            {
                key = KeyPrefix + suffix;
                return true;
            }

            key = string.Empty;
            return false;
        }

        public static string GetKey(uint id) => TryGetKey(id, out var key) ? key : string.Empty;

        public static string GetKey(this LogEventId id) => GetKey((uint)id);

        public static bool TryGetId(string key, out LogEventId id)
        {
            if (string.IsNullOrWhiteSpace(key))
            {
                id = LogEventId.STR_NULL;
                return false;
            }

            var normalizedKey = key.StartsWith(KeyPrefix, StringComparison.Ordinal) ? key : KeyPrefix + key;

            if (KeyToId.TryGetValue(normalizedKey, out var value))
            {
                id = (LogEventId)value;
                return true;
            }

            id = LogEventId.STR_NULL;
            return false;
        }

        public static LogEventId GetOrDefault(uint id) => Enum.IsDefined(typeof(LogEventId), id) ? (LogEventId)id : LogEventId.STR_NULL;
